Parameters vs. Arguments.  

Parameters are used when defining a function, they are the names created in the 
funct ion definition. In fact, during a function definition, can pass in up to 255 
parameters! Parameters are separated by commas in the (). Here’s an example 
with two parameters — param1 & param2 : 
const param1 = true; 
const param2 = false;  
function twoParams(pa ram1, param2){ 
console.log(param1, param2);  
} 

Arguments, on the other hand, are the values the function receives from each 
parameter when the function is executed (invoked). In the above example, our 
two arguments are true & false.  

Invoking a Function.  
Functions execute when the function is called. This process is known as 
invocation. You can invoke a function by referencing the function name, 
followed by an open and closed parenthesis: ().

