Dept of CSE,PESU    Hoisting  
In most of the examples so far, we’ve used var to declare a variable, and we 
have  initialized it with a value. After declaring and initializing, we can access or 
reassign the  variable.  If we attempt to use a variable before it has been declared 
and initialized, it will  return undefined.  
// Attempt to use a variable before declaring it  
  console.log(x);  
// Variable assignment  
  var x = 100;  
 Output  
  undefined  
However, if we omit the var keywor d, we are no longer declaring the variable, 
only initializing it. It will return a ReferenceError and halt the execution of the 
script.  
// Attempt to use a variable before declaring it  
  console.log(x);  
// Variable assignment without var  
  x = 100;  
 Output  
  ReferenceError: x is not defined  
The reason for this is due to hoisting, a behavior of JavaScript in which variable 
and function declarations are moved to the top of their scope. Since only the 
actual declaration is  hoisted, not the initialization, the value in the first example 
returns undefined.  
To demonstrate this concept more clearly, below is the code we wrote and how  
JavaScript actually interpreted it.  
// The code we wrote  
  console.log(x);  
  var x = 100;

Dept of CSE,PESU    // How JavaScript interpreted it  
  var x;  
  console.log(x);  
  x = 100;  
JavaScript saved x to memory as a variable before the execution of the script. 
Since it  was still called before it was defined, the result is undefined and not 
100. However, it  does not cause a ReferenceError and halt the scrip t. Although 
the var keyword did not  actually change location of the var, this is a helpful 
representation of how hoisting works.  
This behavior can cause issues, though, because the programmer who wrote this 
code likely  expects the output of x to be true, w hen it is instead undefined.  
We can also see how hoisting can lead to unpredictable results in the next 
example:  
// Initialize x in the global scope  
  var x = 100;  
function hoist() {  
 // A condition that should not affect the outcome of  the code  
   if (false) {  
    var x = 200;  
   } 
    console.log(x);  
  } 
  hoist();  
  Output  
   undefined  
In this example, we declared x to be 100 globally. Depending on an if statement, 
x could change to 200, but since the condition was false it should not have 
affected the value  of x. Instead, x was hoisted to the top of the hoist() function, 
and the value became  undefined.

Dept of CSE,PESU    This type of unpredictable behavior can potentially cause bugs in a program. 
Since  let and const are block -scoped, they will not hoist in this manner , as seen 
below.  
// Initialize x in the global scope  
  let x = true;  
  function hoist() {  
 // Initialize x in the function scope  
   if (3 === 4) {  
    let x = false;  
   } 
   console.log(x);  
  } 
  hoist();  
  Output  
   true 
