Object initializer  
It is a comma -delimited list of zero or more pairs of property names and associated values of an object, 
enclosed in curly braces ({}): 
var myCar = { 
    make: 'Ford', 
    model: 'Mustang',  
    year: 1969 
}; 
Unassigned properties of an object are undefined  (and not null ). 
myCar.color; // undefined  
Properties of JavaScript objects can also be accessed or set using a bracket not ation (for more details see 
property accessors ). Objects are sometimes called associative arrays , since each property is associated with 
a string value that can be used to access it. So, for example, you could access the properties of the myCar  
object as f ollows:  
myCar['make']  = 'Ford'; 
myCar['model']  = 'Mustang';  
myCar['year']  = 1969; 
An object property name can be any valid JavaScript string, or anything that can be converted to a string, 
including the empty string. However, any property name that is not a valid JavaScript identifier (for 
example, a property name that has a space or a hyphen, or that starts with a number) can only be accessed 
using the square bracket notation. This notation is also very useful when property names are to be 
dynamically dete rmined (when the property name is not determined until runtime). Examples are as follows:  
// four variables are created and assigned in a single go,  
// separated by commas  
var myObj = new Object(),  
    str = 'myString',  
    rand = Math.random(),  
    obj = new Object();  

myObj.type              = 'Dot syntax';  
myObj['date created']    = 'String with space';  
myObj[str]              = 'String value';  
myObj[rand]             = 'Random Number';  
myObj[obj]              = 'Object';  
myObj['']               = 'Even an empty string';  

console.log(myObj); 
Please note that all keys in the square bracket notation  are converted to string unless they're Symbols, since 
JavaScript object  property names (keys) can only be strings or Symbols (at some point, private names will

