the above code, when the key obj is added to the myObj , JavaScript will call the obj.toString()  method, 
and use this result string as the new key.  
You can also access properties by using a string value that is stored in a variable:  
var propertyName = 'make'; 
myCar[propertyName ] = 'Ford'; 

propertyName = 'model';  
myCar[propertyName ] = 'Mustang';  
