Enumerate the properties of an object  
Starting with ECMAScript 5 , there are three native ways to list/traverse object properties:  
 for...in  loops  
This method traverses all enumerable properties of an object and its prototype chain  
 Object.keys(o)  
This method returns an array with all the own (not in the prototype chain) enumerable properties' names 
("keys") of an object o. 
Alternativel y, you can create an object with these two steps:  
1. Define the object type by writing a constructor function. There is a strong convention, with good 
reason, to use a capital initial letter.  
2. Create an instance of the object with new. 
To define an object type , create a function for the object type that specifies its name, properties, and 
methods. For example, suppose you want to create an object type for cars. You want this type of object to be 
called Car, and you want it to have properties for make, model, an d year. To do this, you would write the 
following function:

