  this.make = make;  
  this.model = model;  
  this.year = year;  
} 
Notice the use of this  to assign values to the object's properties based on the values passed to the function.  
Now you can create an object called mycar  as follows:  
var mycar = new Car('Eagle', 'Talon TSi', 1993);  
This statement creates mycar  and assigns it the specified values for its properties. Then the value of 
mycar.make  is the string "Eagle", mycar.year  is the integer 1993, and so on.  
You can create any number of Car objects by calls to new. For example,  
var kenscar = new Car('Nissan', ' 300ZX', 1992);  
var vpgscar = new Car('Mazda', 'Miata', 1990);  
An object can have a property that is itself another object. For example, suppose you define an object called 
person  as follows:  
function Person(name, age, sex) {  
  this.name = name;  
  this.age = age; 
  this.sex = sex;  
} 
and then instantiate two new person  objects as follows:  
var rand = new Person('Rand McKinnon', 33, 'M');  
var ken = new Person('Ken Jones', 39, 'M');  
Then, you can rewrite the definition of Car to include an owner  property that ta kes a person  object, as 
