coordinates at the time and which key was pressed.  
When an event happens, the browser creates an event object, puts details into it 
and passes it as an argument to the handler. A parameter specified with a name 
such as event, evt, or simply e . This is called the event object , and it is 
automatically passed  to event handlers to provide extra features and 
information.  
