 The fetch  method only has one mandatory argument, which is the U RL of the 
resource you wish to fetch.  The Fetch API is a modern interface that allows you 
to make HTTP requests in the web browsers. The  fetch()  method is available in 
the global scope that instructs the browser to send a request to a provided URL.  
Sending  a Request  
The fetch() has only one parameter which most of the time is the URL of the 
resource that you want to fetch:  
 let response = fetch(url);  
The fetch() method returns a Promise so you can use the then() and catch() 
methods to handle it:  
fetch(url)  
    .then(response => {  
        // handle the response  
    }) 
    .catch(error => {  
        // handle the error  
    }); 
When the request completes, the resource is available. At this time, the promise 
will resolve into a Response object.  
The Response object is the API wrapper for the fetched resource. The Response 
object has a number of useful properties and methods to inspect the response.

