 Reading a Response  
If the contents of the response are in the raw text format, you can use the text() 
method. The  text() method returns a Promise that resolves with the complete 
contents of the fetched resource:  
fetch('/readme.txt')  
    .then(response => response.text())  
    .then(data => console.log(data));  
Or async/await  can be used : 
async function fetchText() {  
    let response = await fetch('/readme.txt');  
    let data = await response.text();  
    console.log(data);  
} 
Besides the text() method, the Response object has other methods such as 
json(), blob(), formData() and arrayBuffer() to handle respective data.  
