• The only way to report errors to Express for use with error handlers is 
using the third argument to conventional middleware, the next 
() function.  
• Route handlers (like app.get(‘/User’, function (req, res){}))  can also take 
a next()  function as an argument  

• Express middleware executes  in order . You should define error 
handlers  last, after all other middleware. Otherwise, your error handler 
won't get called:  
const app = require('express')();  

app.use(function(error, req, res, next) {  
  // Will **not** get ca lled. You'll get Express' default error  
  // handler, which returns `error.toString()` in the error body  
  console.log('will not print');  
  res.json({ message: error.message });  
