Forms are an integral part of the web.  
To get started with forms, we will first install the  body -parser (for parsing 
JSON and url -encoded data) and multer(for parsing multipart/form data) 
middleware.  
To install the  body -parser  and multer , go to your terminal and use −  
npm install body -parser multer  
After importing the body parser and multer, we will use the  body -
parser  for parsing json and x -www -form-urlencoded header requests, 
while we will use  multer  for parsing multipart/form -data.  
Replace your  index.js  file contents with the following code – 

var express = require ('express' ); 
var bodyParser = require ('body -parser' ); 
var multer = require ('multer' ); 
var upload = multer (); 
var app = express (); 
//Read form saved as form.pug  
app.get('/', function (req, res){ 
   res.render ('form' ); 
}); 
//Creating a view  
app.set('view engine' , 'pug' ); 
app.set('views' , './views' ); 

// for parsing application/json  
app.use(bodyParser .json());  
app.use(bodyParser .urlencoded ({ extended : true  }));

//form -urlencoded for parsing multipart/form -data  
app.use(upload .array ());  
app.use(express .static ('public' )); 

app.post ('/', function (req, res){ 
   console .log(req.body ); 
   res.send ("Request is received!" ); 
}); 
app.listen (3000 ); 

